import java.io.BufferedOutputStream;
import java.io.ByteArrayOutputStream;
import java.io.PrintWriter;
import java.nio.charset.StandardCharsets;
import java.util.Base64;
import java.util.Scanner;
import java.util.zip.Inflater;

@Launchable(author = "Evermore", hostname = "probook", judge = "CSES")
public class GridPathDescription extends ModuleSignatures implements Runnable {

  private final Scanner in = new Scanner(System.in);
  private final PrintWriter out = new PrintWriter(new BufferedOutputStream(System.out));

  @Override
  public void run() {
    int t = 1;
    for (int _case = 1; _case <= t; _case++) {
      this.solveCase(_case);
    }
    this.out.flush();
  }

  public static void main(String... args) {
    new Thread(null, new GridPathDescription(), "LaunchableDriver", 1048576L).start();
  }

  private void solveCase(int _case) {
    byte[] input = in.nextLine().getBytes(StandardCharsets.UTF_8);
    byte[] paths = new byte[0];

    try {
      StringBuilder sb = new StringBuilder();
      sb.append(D0);
      sb.append(D1);
      sb.append(D2);

      byte[] zlib = Base64.getDecoder().decode(sb.toString());
      Inflater inflater = new Inflater();
      inflater.setInput(zlib);

      ByteArrayOutputStream baos = new ByteArrayOutputStream(zlib.length * 4);
      byte[] buf = new byte[4096];

      while (!inflater.finished()) {
        baos.write(buf, 0, inflater.inflate(buf));
      }

      byte[] delta = baos.toByteArray();
      int numPaths = 88418;

      byte[] full = new byte[numPaths * 48];
      byte[] lastPacked = new byte[12];

      int ptr = 0;
      for (int i = 0; i < numPaths; i++) {
        int same = delta[ptr++] & 0xFF;

        for (int j = same; j < 12; j++) {
          lastPacked[j] = delta[ptr++];
        }

        int base = i * 48;
        for (int j = 0; j < 12; j++) {
          int b = lastPacked[j] & 0xFF;
          full[base + j * 4 + 0] = MAP[(b >> 6) & 3];
          full[base + j * 4 + 1] = MAP[(b >> 4) & 3];
          full[base + j * 4 + 2] = MAP[(b >> 2) & 3];
          full[base + j * 4 + 3] = MAP[(b >> 0) & 3];
        }
      }

      inflater.end();
      paths = full;
    } catch (Exception e) {
      System.err.println("INVALID DATA");
    }

    int cnt = 0, index = 0;
    while (index < paths.length) {
      int i = 0;
      while (true) {
        if (input[i] != '?' && input[i] != paths[index + i]) {
          break;
        } else {
          i += 1;
          if (i == 48) {
            cnt += 1;
            break;
          }
        }
      }

      index += 48;
    }

    out.println(cnt);
  }
}

@MultipleInheritanceDisallowed(inheritor = GridPathDescription.class)
abstract class ModuleSignatures {
  protected static final byte[] MAP = { (byte) 'D', (byte) 'L', (byte) 'R', (byte) 'U' };
  protected static final String D0 = "";
  protected static final String D1 = "";
  protected static final String D2 = "";
}

@FunctionalInterface
interface Procedure {
  void run();
}

@FunctionalInterface
interface LongFunction {
  long apply(long t);
}

@java.lang.annotation.Retention(java.lang.annotation.RetentionPolicy.RUNTIME)
@java.lang.annotation.Target(java.lang.annotation.ElementType.TYPE)
@interface Launchable {
  String author();

  String hostname();

  String judge();
}

@java.lang.annotation.Retention(java.lang.annotation.RetentionPolicy.SOURCE)
@java.lang.annotation.Target(java.lang.annotation.ElementType.TYPE)
@interface MultipleInheritanceDisallowed {
  Class<?> inheritor();
}

@java.lang.annotation.Retention(java.lang.annotation.RetentionPolicy.RUNTIME)
@java.lang.annotation.Target(java.lang.annotation.ElementType.TYPE)
@interface Singleton {
}
